import 'vue';
import './helpers.mjs';
import './config.mjs';
import { b as registerComponent } from './plugins-8a0db0e9.mjs';
import { s as script } from './Tooltip-d939a9f8.mjs';
export { s as OTooltip } from './Tooltip-d939a9f8.mjs';

var index = {
    install(app) {
        registerComponent(app, script);
    }
};

export default index;
